import { Container } from 'react-bootstrap';
import 'react-calendar/dist/Calendar.css';
import Calendars from './component/Calendars';
import styled from 'styled-components';

function App() {
  const Wrapper = styled.div`
    margin: 0 auto;
  `;
  return (
    <Wrapper>
      <Container>
        <Calendars />
      </Container>
    </Wrapper>
  );
}

export default App;
